import React from "react";

import { Meta } from "../layout/Meta";
import { Main } from "../templates/Main";
import { Line } from "react-chartjs-2";

export const chartConfig = {
  type: "line",
  data: {
    labels: [
      "(time unknown)",
      "12:42 AM",
      "(time unknown)",
      "2:58 AM",
      "(time unknown)",
      "(time unknown)",
    ],
    datasets: [
      {
        data: [null, null, null, 0.16, null, null],
        label: "Genesis Petrillo",
        backgroundColor: "#374151",
        borderColor: "#374151",
        fill: false,
      },
    ],
  },

  options: {
    title: {
      display: true,
      text: "BAC Analysis - Robert Cannon M.D.",
      fontSize: 24,
      fontFamily: "'Helvetica'",
    },
    scales: {
      xAxes: [
        {
          scaleLabel: {
            display: true,
            labelString: "Known Times (AM)",
          },
          ticks: {
            callback: function (value: String, index, values) {
              if (value === "2:58 AM") {
                return value;
              }
            },
          },
        },
      ],
      yAxes: [
        {
          scaleLabel: {
            display: true,
            labelString: "Blood Alcohol Concentration (g/ml)",
          },
          ticks: {
            callback: function (value, index, values) {},
          },
        },
      ],
    },
  },
};

const state = {
  labels: ["January", "February", "March", "April", "May"],
  datasets: [
    {
      label: "Rainfall",
      fill: false,
      lineTension: 0.5,
      backgroundColor: "rgba(75,192,192,1)",
      borderColor: "rgba(0,0,0,1)",
      borderWidth: 2,
      data: [65, 59, 80, 81, 56],
    },
  ],
};

const Index = () => (
  <Main
    meta={
      <Meta
        title="Cannon Demonstrative"
        description="The demonstrative for Dr. Robert Cannon - Gardner Consulting."
      />
    }
  >
    <div className="m-20">
      <Line data={state} options={{ chartConfig }}></Line>
    </div>
  </Main>
);

export default Index;
